":{"text":"I always wondered when I would find someone who would Love like how I Love. Which is Love that is deep, passionate, sincere, and true, ultimately everlasting. Before she came into my life I didn't believe in it, I didn't believe that anyone was capable of Love that existed in that form like how I believed in it. I was always used of seeing people get together break up and find someone else in a matter of short moments. I was never like that, once my heart breaks I disappear in to shadows where no one can find me nor even get close to me for a long time. I dont jump from one person to another like most people would. Because I believed in something much different then them. I would be cold hearted and closed off from people, it was my defense mechanism. \nBut for some reason she found a way to melt that ice that encased my heart. Slowly the warmth she brought into my life made me feel whole again, free, and less restrained to Love. I remember looking into her brown eyes and I just smile because I saw someone who Loved like how I Love. Everything fell into place so perfectly, like we were designed to meet and be together, like the Universe wanted us here at that very moment. Unlike anything I've ever felt before. It was amazing, I fell deeply in Love for the first time. Then it rained on me pouring treacherously, pain once again aching my heart.....but still I walk in this rain with a warm heart that she created, still madly in Love with no sign of it ever fading. Why you may ask? Because True Love comes once in a lifetime. And she is the True Love that I've been waiting for. So I continue to hold on for however long it may take, because I Love Her and I trust her. Patiently waiting for the storm to clear. In the mean time I continue having this warm heart because of you [T\ud83d\udda4] so I wait. \u2764 #iloveher #inlove #instaquotes #instagram #music #photo #follow4follow #amazing #beach #likeforlikes #vapeshop #vape #model #sexy #nofilter #travel #life #beauty #hiphop #real #nature #smile #fun #livelifetothefullest #style #art #instadaily #followmenow\u00a0 #followmeback #quotestoliveby"}}]},"shortcode":"BtAAjeLlEP4","edge_media_to_comment":{"count":1},"taken_at_timestamp":1548296063,"dimensions":{"height":422,"width":750},"display_url":"https://scontent-sjc3-1.cdninstagram.com/vp/fc7bb58401349ca5cc6ef7bcc3905ebf/5C4B3528/t51.2885-15/e35/50689151_805922893083027_3194089849899170323_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com","edge_liked_by":{"count":6},"edge_media_preview_like":{"count":6},"owner":{"id":"8408539969"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/vp/bdd6baae68ee5b31c1c981cfd4f7c09f/5C4BAC43/t51.2885-15/e35/c157.0.406.406/50689151_805922893083027_3194089849899170323_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/vp/97e2440b8ec7c5226c123b1a13f166e6/5C4BA341/t51.2885-15/e35/c157.0.406.406/s150x150/50689151_805922893083027_3194089849899170323_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/vp/d2b815050dd787d3a0aa582b6956f7fc/5C4B434B/t51.2885-15/e35/c157.0.406.406/s240x240/50689151_805922893083027_3194089849899170323_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com","config_width":240,"config_height":240},{"src":"https://scontent-sjc3-1.cdninstagram.com/vp/5e3fb3997bd772e5002cbfed48af41d2/5C4B7631/t51.2885-15/e35/c157.0.406.406/s320x320/50689151_805922893083027_3194089849899170323_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com","config_width":320,"config_height":320},{"src":"https://scontent-sjc3-1.cdninstagram.com/vp/bdd6baae68ee5b31c1c981cfd4f7c09f/5C4BAC43/t51.2885-15/e35/c157.0.406.406/50689151_805922893083027_3194089849899170323_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com","config_width":480,"config_height":480},{"src":"https://scontent-sjc3-1.cdninstagram.com/vp/bdd6baae68ee5b31c1c981cfd4f7c09f/5C4BAC43/t51.2885-15/e35/c157.0.40
